import React from 'react'

const CartList = ({car}) => {
    
  return (
    <div>
        {
         cartList.map((items,index)=>{
                return(
                    <div key={index}>
                      <img src={items.url} alt="" height='20px' width='20px' />
                    </div>
                )
            })
        }
    </div>
  )
}

export default CartList
